import GTComp04 from "../GettingThereComp/GTComp04.jsx";

const GTCard01 = () => {
        return (
        <>
            <div className="map-header">
            <GTComp02 />
            </div>
            <div className="map">
            <GTComp01 />
            </div>
            <div className="map-info">
            <GTComp03 />
            </div>
            <div style={{textAlign:"center"}}>
            <GTComp04 />
            </div>
        </>
    );
     

        }

